import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';

// Временные заглушки для страниц с РАЗНЫМИ именами
const PriceListTemp = () => <div style={{ padding: '50px', color: 'white', background: '#000' }}>Страница прайс-листа</div>;
const GameTemp = () => <div style={{ padding: '50px', color: 'white', background: '#000' }}>Игра "Найди ошибку"</div>;
const ContactsTemp = () => <div style={{ padding: '50px', color: 'white', background: '#000' }}>Контакты</div>;

function App() {
  return (
    <Router>
      <div style={{
        minHeight: '100vh',
        background: '#000000',
        fontFamily: 'Arial, sans-serif'
      }}>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/pricelist" element={<PriceListTemp />} />
          <Route path="/game" element={<GameTemp />} />
          <Route path="/contacts" element={<ContactsTemp />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
